import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

export default function Results() {
  const location = useLocation();
  const navigate = useNavigate();
  const results = location.state;

  console.log('Results data received:', results); // Debug log

  if (!results) {
    return (
      <div style={{ padding: '20px', textAlign: 'center' }}>
        <h2>No Results Found</h2>
        <p>Something went wrong. Please try again.</p>
        <button 
          onClick={() => navigate('/join')}
          style={{
            padding: '10px 20px',
            backgroundColor: '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Join Quiz
        </button>
      </div>
    );
  }

  // Filter only wrong answers
  const wrongAnswers = results.detailedAnswers ? 
    results.detailedAnswers.filter(answer => answer.result === 'Incorrect') : [];

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto' }}>
      <h2>Quiz Results</h2>
      
      <div style={{ 
        backgroundColor: '#f8f9fa', 
        padding: '20px', 
        borderRadius: '8px', 
        marginBottom: '20px' 
      }}>
        <h3>Score Summary</h3>
        <p><strong>Student Name:</strong> {results.participantName || 'Unknown Student'}</p>
        <p><strong>Final Score:</strong> {results.totalScore}/{results.maxPossibleScore}</p>
      </div>

      {wrongAnswers.length > 0 && (
        <div style={{ marginBottom: '20px' }}>
          <h3 style={{ color: '#dc3545' }}>Wrong Answers ({wrongAnswers.length})</h3>
          {wrongAnswers.map((answer, index) => (
            <div 
              key={index}
              style={{
                backgroundColor: '#fff',
                border: '1px solid #dee2e6',
                borderRadius: '8px',
                padding: '15px',
                marginBottom: '15px'
              }}
            >
              <h4 style={{ color: '#dc3545', marginTop: '0' }}>Question {answer.questionNumber}</h4>
              <p><strong>Question:</strong> {answer.question}</p>
              <p><strong>Your Answer:</strong> <span style={{ color: '#dc3545' }}>{answer.yourAnswer}</span></p>
              <p><strong>Correct Answer:</strong> <span style={{ color: '#28a745' }}>{answer.correctAnswer}</span></p>
            </div>
          ))}
        </div>
      )}

      {wrongAnswers.length === 0 && (
        <div style={{ 
          backgroundColor: '#d4edda', 
          border: '1px solid #c3e6cb',
          borderRadius: '8px',
          padding: '20px',
          textAlign: 'center',
          marginBottom: '20px'
        }}>
          <h3 style={{ color: '#155724', margin: '0' }}>🎉 Perfect Score!</h3>
          <p style={{ color: '#155724', margin: '10px 0 0 0' }}>No wrong answers! Excellent work!</p>
        </div>
      )}

      <div style={{ textAlign: 'center' }}>
        <button 
          onClick={() => navigate('/join')}
          style={{
            padding: '12px 24px',
            backgroundColor: '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer',
            fontSize: '16px'
          }}
        >
          Take Another Quiz
        </button>
      </div>
    </div>
  );
}
